<!DOCTYPE html>
<html>
<script type="text/javascript">
    function loc()
    {
        var browserLanguage = (navigator.language) ? navigator.language : navigator.userLanguage;

        var t, h, p;

        switch (browserLanguage.toLowerCase())
        {
            case "en-us":
                t = "Azure Stack App Service - Welcome";
                h = "This web app has been successfully created";
                p = "There is nothing here yet, but Microsoft Azure Stack App Service Web Apps makes it simple to publish content with GIT, FTP or your favorite development tool.";
                break;
            case "de-de":
                t = "Azure Stack App Service – Willkommen";
                h = "Die Website wurde erfolgreich erstellt.";
                p = "Es wurde noch nichts erstellt, aber Websites vereinfachen die Veröffentlichung von Inhalten mit GIT, FTP oder Ihrem bevorzugten Entwicklungstool.";
                break;
            case "es-es":
                t = "Azure Stack App Service - Inicio";
                h = "Esta web app se ha creado correctamente";
                p = "Actualmente no hay contenido, pero Microsoft Azure Stack App Service Web Apps facilita la publicación de contenido con GIT, FTP o su herramienta de desarrollo preferida.";
                break;
            case "fr-fr":
                t = "Azure Stack App Service - Bienvenue";
                h = "Ce site Web a été correctement créé";
                p = "Il n'y a rien ici encore, mais Sites Web facilite la publication de contenu avec GIT, FTP ou votre outil de développement favori.";
                break;
            case "it-it":
                t = "Azure Stack App Service - Pagina introduttiva";
                h = "Il sito Web è stato creato correttamente";
                p = "Non vi è ancora alcun elemento, tuttavia tramite i siti Web è possibile pubblicare facilmente i contenuti tramite GIT, FTP o lo strumento di sviluppo preferito.";
                break;
            case "ja-jp":
                t = "Web サイト - ようこそ";
                h = "この Web サイトは正常に作成されました";
                p = "ここにはまだ何もありませんが、Web サイトを使用すると GIT、FTP、またはその他の開発ツールでコンテンツを容易に公開できます。";
                break;
            case "ko-kr":
                t = "웹 사이트 - 시작";
                h = "이 웹 사이트가 생성되었습니다.";
                p = "아직 여기에 아무 것도 없지만 GIT, FTP 또는 선호하는 개발 도구를 사용하여 웹 사이트로 콘텐츠를 간단하게 게시할 수 있습니다.";
                break;
            case "pt-br":
                t = "Azure Stack App Service - Bem-vindo";
                h = "Este site foi criado com sucesso";
                p = "Ainda não há nada aqui, mas os sites facilitam a publicação de conteúdo com GIT, FTP ou outra ferramenta de desenvolvimento favorita.";
                break;
            case "ru-ru":
                t = "Веб-сайты ― добро пожаловать";
                h = "Этот веб-сайт успешно созда";
                p = "Пока здесь ничего нет, но с помощью веб-сайтов вы можете легко публиковать содержимое посредством GIT, FTP или другого средства разработки, которое вы предпочитаете.";
                break;
            case "tr-tr":
                t = "Azure Stack App Service Hoşgeldiniz";
                h = "Web sitesi başarıyla oluşturuldu";
                p = "Burada henüz yayınlanmış içerik bulunmamaktadır, ama Windows Azure Stack App Service sayesinde GIT, FTP veya en sevdiğiniz geliştirme aracını kullanarak kolayca içerik yayınlayabilirsiniz.";
                break;
            case "zh-hans":
                t = "网站 - 欢迎";
                h = "已成功创建此网站";
                p = "这里现在不包含任何内容，但是在网站上使用 GIT、FTP 或您喜爱的开发工具可以轻松发布内容。";
                break;
            case "zh-hant":
                t = "網站 - 歡迎使用";
                h = "已成功建立這個網站";
                p = "尚無內容，但網站讓您輕鬆地使用 GIT、FTP 或最愛的開發工具發佈內容。";
                break;
            default: t = "Azure Stack App Service - Welcome";
                h = "This web app has been successfully created";
                p = "There is nothing here yet, but Azure Stack App Service makes it simple to publish content with GIT, FTP or your favorite development tool.";
        }

        document.title = t;
        document.getElementById("siteCreated").innerHTML = h;
        document.getElementById("goDo").innerHTML = p;
}
</script>
